import React from "react"

function Nav() {
    return (
        <nav className="nav">
            <div className="nav-link-box">
            <img src="../public/images/vgrade-logo.png"></img>
                <a className="nav-link" href="#">Vgrade</a>
            </div>
        </nav>
    );
}

export default Nav;
